import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the search modal
    await page.click('button.close-modal'); // Assuming this opens the search modal
    await page.waitForSelector('#searchInput');

    // Take screenshot after opening the search modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_modal_opened.png'));

    // Click the remove button (×) on the first recent search item
    await page.waitForSelector('.search-item:first-child .remove-search');
    await page.click('.search-item:first-child .remove-search');

    // Take screenshot after removing the search item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_removed_first_recent_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_removed_first_recent_search.png'));

    return {
      success: true,
      action: "Opened search modal and clicked remove button on first recent search item",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

